let {
    setValue,
    registerClientListener
} = ggbApplet;

let game = {
    cards: {
        C1: 1,
        C2: 10,
        C3: 10,
        C4: 10,
        C5: 1,
        C6: null,
        C7: 10,
        C8: 100,
        C9: 10,
        C10: 100,
        C11: 100,
        C12: 10,
        C13: 100,
        C14: 10,
        C15: 100,
        C16: 100
    },
    board: [
        "C1", "C2", "C3", "C4",
        "C5", "C6", "C7", "C8",
        "C9", "C10", "C11", "C12",
        "C13", "C14", "C15", "C16",
    ],
    JOKER: "C6",
    get jokerIndex() { return this.board.indexOf(this.JOKER) },
    playerCards: [
        [],
        []
    ],
    automaticPlay: null,
    playRow: null,
    playColumn: null,
    playTurn: null,
    playType: null,
    running: false
}

function ggbOnInit() {
    registerClientListener(handleClick);
}

function handleClick(e) {
    if (game.running && e.type === "mouseDown") {
        if (e.x >= 0 && e.x <= 8 && e.y >= 0 && e.y <= 5.2) {
            let index = getClickPos(e.x, e.y);

            if (canPickCard(index)) {
                pickCard(index);
                
                if (isGameOver()) {
                    endGame();
                } else {
                    updateText();
                    if (isComputerTurn()) playComputerTurn(); 
                }
            }
        }
    }
}

function canPickCard(index) {
    return game.board[index] !== null && 
        !isJokerCard(index) && (
        (isColumnTurn() && isJokerColumn(index)) || 
        (isRowTurn() && isJokerRow(index))
    );
}

function pickCard(index) {
    addCardToPlayer(game.playTurn, game.board[index]);
    pickCardSFX.play()
    moveJoker(index);
    game.playTurn = getNextTurn();
}

function getRow(index) { return Math.floor(index / 4); }
function getColumn(index) { return index % 4; }
function getX(index) { return getColumn(index) * 2; }
function getY(index) { return 3.9 - getRow(index) * 1.3; }

function getClickPos(x, y) {
    let row = Math.floor((5.2 - y) / 1.3);
    let column = Math.floor(x / 2);

    return column + row * 4;
}

function isJokerCard(index) { return game.board[index] === game.JOKER; }
function isJokerColumn(index) { return getColumn(game.jokerIndex) === getColumn(index); }
function isJokerRow(index) { return getRow(game.jokerIndex) === getRow(index); }

function updateBoard() {
    resetBoard();
    randomizeBoard();

    for (let i = 0; i < game.board.length; i++) {
        setValue(game.board[i] + "x", getX(i));
        setValue(game.board[i] + "y", getY(i));
    }
}

function resetBoard() {
    game.board = [
        "C1", "C2", "C3", "C4",
        "C5", "C6", "C7", "C8",
        "C9", "C10", "C11", "C12",
        "C13", "C14", "C15", "C16",
    ];
}

function randomizeBoard() {
    for (let i = 0; i < 5; i++) {
        for (let j = 0; j < game.board.length; j++) {
            let k = Math.floor(Math.random() * game.board.length);

            [game.board[j], game.board[k]] = [game.board[k], game.board[j]];
        }
    }
}

function moveJoker(index) {
    setValue(game.JOKER + "x", getX(index));
    setValue(game.JOKER + "y", getY(index));

    game.board[game.jokerIndex] = null;
    game.board[index] = game.JOKER;
}

function addCardToPlayer(player, card) {
    game.playerCards[player - 1].push(card);
    game.playerCards[player - 1].sort((a, b) => game.cards[b] - game.cards[a]);

    updatePlayerCards(player);
}

function updatePlayerCards(player) {
    let y = player === 1 ? -2.6 : -4.9;
    
    game.playerCards[player - 1].forEach((card, index) => {
        setValue(card + "x", -4.6 + index * 2.1);
        setValue(card + "y", y);
    });
}

function updateText() {
    setValue("turn", game.playTurn);
    setValue("row", game.playRow === game.playTurn);
    setValue("column", game.playColumn === game.playTurn);
}

function isGameOver() { return (isRowTurn() && isRowEmpty()) || (isColumnTurn() && isColumnEmpty()); }
function isRowTurn() { return game.playRow === game.playTurn; }
function isColumnTurn() { return game.playColumn === game.playTurn; }
function isComputerTurn() { return game.automaticPlay && game.playTurn === 2; }
function getNextTurn() { return game.playTurn === 1 ? 2 : 1; }

function isRowEmpty() {
    let row = getRow(game.jokerIndex);

    return !game.board.slice(row * 4, (row + 1) * 4).some(v => v !== null && v !== game.JOKER);
}

function isColumnEmpty() {
    let column = getColumn(game.jokerIndex);

    for (let row = 0; row < 4; row++) {
        if (game.board[row * 4 + column] !== null && 
            game.board[row * 4 + column] !== game.JOKER
        ) return false;
    }

    return true;
}

function setAutomaticPlay(value) {
    setValue("automaticPlay", value);
    game.automaticPlay = value === null ? null : value === 2;
}

function setWhoStarts(value) {
    setValue("whoStarts", value);
    game.playTurn = value;
}

function setWhoPlaysRow(value) {
    setValue("whoPlaysRow", value);
    game.playType = value;
}

function startGame() {
    if (game.automaticPlay !== null && game.playType !== null && game.playTurn !== null) {
        setValue("gameStarted", true);
        game.running = true;

        if (game.playType === 1) {
            game.playRow = game.playTurn;
            game.playColumn = getNextTurn();
        } else {
            game.playRow = getNextTurn();
            game.playColumn = game.playTurn;
        }

        updateText();
        if (isComputerTurn()) playComputerTurn(); 
    }
}

function endGame() {
    game.running = false;
    setValue("end", true);
}

function newGame() {
    updateBoard();
    reset();
}

function reset() {
    game.playerCards = [[], []];
    setValue("gameStarted", false);
    setValue("end", false);
    setAutomaticPlay(null);
    setWhoStarts(null);
    setWhoPlaysRow(null);
}

async function playComputerTurn() {
    game.running = false;
    await sleep(2000);

    if (game.playColumn === 2) playColumn();
    else playRow();

    if (isGameOver()) {
        endGame();
    } else {
        updateText();
        game.running = true;
    }
}

function autoPlay(getNewIndex) {
    let bestOption = { gain: null, index: null };

    for (let i = 0; i < game.board.length; i++) {
        if (canPickCard(i)) {
            let gain = game.cards[game.board[i]];
            let prejudice = 0;

            for (let j = 0; j < 4; j++) {
                let newIndex = getNewIndex(i, j);

                if (newIndex === i) continue;
                if (game.board[newIndex] === null) continue;

                prejudice = Math.max(game.cards[game.board[newIndex]], prejudice);
            }

            gain -= prejudice;

            if (bestOption.gain === null || bestOption.gain < gain) {
                bestOption.gain = gain;
                bestOption.index = i;
            }
        }
    }

    pickCard(bestOption.index);
}

function playColumn() { return autoPlay((i, j) => getRow(i) * 4 + j); }
function playRow() { return autoPlay((i, j) => getColumn(i) + 4 * j); }
function sleep(ms) { return new Promise(resolve => setTimeout(resolve, ms)); }

let pickCardSFX = new Audio("data:audio/wav;base64,");